import './Home.css';
import {useState} from "react";

function Header() {
    return (
        <div className="home">
            <div className="header">
                <div className="header-name">
                    <a>
                        <p>Jimmy Tran</p>
                    </a>
                </div>
                <div className="header-work">
                    <a>
                        <p>Work</p>
                    </a>
                </div>
                <div className="header-about">
                    <a>
                        <p>About</p>
                    </a>
                </div>
                <div className="header-contact">
                    <a>
                        <p>Contact</p>
                    </a>
                </div>
            </div>
        </div>
    )
}

function Intro() {
    return (
        <div>
            
        </div>
    )

}


export default function Home() {
    return (
        <div>
            <Header />
            <Intro />
        </div>
    )
}
